// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CertificationContract {

    struct Product {
        string name;
        string origin;
        string produceDate;
        string farmerName;
        bool pgcApproved;
        bool thirdPartyApproved;
        bool certified;
        uint256 certificateId;
    }

    address public certIssuer;
    address public pgcApprover;
    address public thirdPartyApprover;

    uint256 public certificateCounter;
    mapping(uint256 => Product) public certificates;
    mapping(bytes32 => Product) public productRequests;

    event ProductSubmitted(bytes32 productHash, string name);
    event PGCApproved(bytes32 productHash);
    event ThirdPartyApproved(bytes32 productHash);
    event CertificateIssued(uint256 certificateId, bytes32 productHash);

    modifier onlyIssuer() {
        require(msg.sender == certIssuer, "Only Cert Issuer allowed");
        _;
    }

    modifier onlyPGC() {
        require(msg.sender == pgcApprover, "Only PGC can approve");
        _;
    }

    modifier onlyThirdParty() {
        require(msg.sender == thirdPartyApprover, "Only Third Party can approve");
        _;
    }

    constructor(address _pgcApprover, address _thirdPartyApprover) {
        certIssuer = msg.sender;
        pgcApprover = _pgcApprover;
        thirdPartyApprover = _thirdPartyApprover;
    }

    function submitProduct(
        string memory _name,
        string memory _origin,
        string memory _produceDate,
        string memory _farmerName
    ) public onlyIssuer {
        bytes32 productHash = keccak256(
            abi.encodePacked(_name, _origin, _produceDate, _farmerName)
        );
        require(bytes(productRequests[productHash].name).length == 0, "Product already submitted");

        productRequests[productHash] = Product({
            name: _name,
            origin: _origin,
            produceDate: _produceDate,
            farmerName: _farmerName,
            pgcApproved: false,
            thirdPartyApproved: false,
            certified: false,
            certificateId: 0
        });

        emit ProductSubmitted(productHash, _name);
    }

    function approveByPGC(bytes32 productHash) public onlyPGC {
        require(bytes(productRequests[productHash].name).length != 0, "Invalid product");
        productRequests[productHash].pgcApproved = true;
        emit PGCApproved(productHash);
    }

    function approveByThirdParty(bytes32 productHash) public onlyThirdParty {
        require(productRequests[productHash].pgcApproved, "PGC approval required first");
        productRequests[productHash].thirdPartyApproved = true;
        emit ThirdPartyApproved(productHash);

        // Final certification step
        _generateCertificate(productHash);
    }

    function _generateCertificate(bytes32 productHash) internal {
        Product storage product = productRequests[productHash];
        require(product.pgcApproved && product.thirdPartyApproved, "All approvals required");
        require(!product.certified, "Already certified");

        certificateCounter++;
        product.certified = true;
        product.certificateId = certificateCounter;
        certificates[certificateCounter] = product;

        emit CertificateIssued(certificateCounter, productHash);
    }

    function getCertificate(uint256 _id) public view returns (
        string memory name,
        string memory origin,
        string memory produceDate,
        string memory farmerName,
        bool pgcApproved,
        bool thirdPartyApproved
    ) {
        Product memory cert = certificates[_id];
        return (
            cert.name,
            cert.origin,
            cert.produceDate,
            cert.farmerName,
            cert.pgcApproved,
            cert.thirdPartyApproved
        );
    }
}

